import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";

const InstaCard = ({
  imageUrl,
  username,
  likes,
  timestamp,
  thumbnailUrl,
  comments
}) => {
  console.log(props.item);

  return (
    <div>
      <Card
        style={{
          marginBottom: 100
        }}
      >
        <CardImg top width="100%" src={thumbnailUrl} alt="Card image cap" />
        <CardBody>
          <CardTitle>Card title</CardTitle>
          <CardSubtitle>Card subtitle</CardSubtitle>
          <CardText>
            Some quick InstaCard text to build on the card title and make up the
            bulk of the card's content.
          </CardText>
          <Button>Button</Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default InstaCard;
